import React from 'react';
import './contacts.css';
import location from '../img/location.jpg';

const Contacts = () => {
    return ( 
        <React.Fragment>
            <div className="container-fluid">
                <div className="banner">
                </div>
                <div className="row">
                    <div className="col-lg-6">
                        <img src={location} alt=""/>
                    </div>
                    <div className="col-lg-6">
                        
                    </div>  
                </div>
            </div>
        </React.Fragment>
    );
}
 
export default Contacts;
